import Header from './components/Header';
import Home from './components/Home';
import { BrowserRouter as Router, Route, Switch, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App" dir="rtl">
  <Router>
    <Header />
    <Routes>
      <Route exact path='/' element={<Home />} />
    </Routes>
  </Router>
</div>

  );
}

export default App;
